import React from "react";
import ReactDom from "react-dom/client";

const root = ReactDom.createRoot(document.getElementById("root"));

function Card() {
  return (
    <>
      <h1>Top Webseries of Amazom Prime are Here !</h1>
      <div className="cards">
        <div className="card">
          <img src="https://images-eu.ssl-images-amazon.com/images/S/pv-target-images/0fcaec1ea6c17599b666f6ffd1173c923362cdaa4f7472d16ee4fbcb42d63292._UR1920,1080_RI_SX356_FMwebp_.jpg" alt="Picture" className="card__img" />
          <div className="card__info">
            <span className="card__category">An Amazon Prime Series </span>
            <h3 className="card__title">Twenty One Hours </h3>
            <a href="https://www.primevideo.com/detail/0O5IL70DUOP7KOCHX9RWX9VDRX/ref=atv_mv_hom_1_c_vRJ6BI_brws_2_3" target="_blank">
              <button>Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  )
}

